  "privacy_modal_subtitle": "Meie privaatsuse ja turvalisuse põhimõtted",
  "privacy_content": "<h2>Privaatsusteatis</h2><p>See privaatsusteatis kehtib PharmaLedger Association Electronic Product Information toote kasutamise kohta.</p><h2>Kontaktid</h2><p><b>a) Andmekontrolleri või ühisandmekontrollerite isikuandmed ja kontaktid</b></p><p>Teie andmete kontroller on PharmaLedger Association.</p><p><b>b) Andmekaitseametniku kontaktandmed </b></p><p>PharmaLedger Association'i Andmekaitseametnikuga saab ühendust võtta e-posti aadressil dpo@pharmaledger.org.</p><h2>Milliseid isikuandmeid me kasutame</h2><p>Kogume ainult tehnilisi andmeid, mis on vajalikud teie elektroonilise infolehe edastamiseks. Nende hulka kuuluvad teie IP-aadress ja seadme ning veebibrauseri tehnilised tuvastusandmed, mida kasutate meie rakendusele juurdepääsuks.</p><p>Üksikasjalikult kogume järgmisi andmeelemente: </p><ul><li><p><em>Mobiilseadme ligipääs.</em> Võime paluda juurdepääsu või luba teatud funktsioonidele teie mobiilseadmest, sealhulgas teie mobiilseadme kaamerale ja teistele funktsioonidele. Kui soovite muuta meie juurdepääsu või lubasid, saate seda teha oma seadme seadetes.</p></li><li><p><em>Mobiilseadme andmed.</em> Kogume automaatselt seadmeandmeid (nagu teie mobiilseadme ID, mudel ja tootja), operatsioonisüsteemi, versiooniinfot ja süsteemi seadistuste teavet, seadme ja rakenduse identifitseerimisnumbreid, brauseri tüüpi ja versiooni, riistvara mudelit, internetiteenuse pakkuja ja/või mobiilsideoperaatori ning Interneti-protokolli (IP) aadressi (või puhverserveri). Kui kasutate meie rakendust, võime koguda ka teavet teie mobiilseadmega seotud telefonivõrgu kohta, teie mobiilseadme operatsioonisüsteemi või platvormi, kasutatava mobiilseadme tüübi, teie mobiilseadme unikaalse seadme ID ning teavet meie rakenduste funktsioonide kohta, millele tekasutasite.</p></li></ul><h2>Miks me kogume teie isikuandmeid</h2><h3>Eesmärgid</h3><p>Kogume teie tehnilisi andmeid eesmärgiga pakkuda teile elektroonilist tootekleepsu teie ravimi jaoks.</p><p>Sellisel juhul võime tugineda järgmistele õiguslikel alustel teie isikuandmete töötlemiseks:</p><ul><li><p><b>lepingu täitmine.</b> Me võime töödelda teie isikuandmeid, kui me usume, et see on vajalik teiega sõlmitud lepinguliste kohustuste täitmiseks, sealhulgas meie teenuste pakkumiseks või teie taotlusel enne lepingu sõlmimist teiega.</p></li><li><p><b>Õiguslikud kohustused</b>. Me võime töödelda teie teavet, kui me usume, et see on vajalik meie õiguslike kohustuste täitmiseks, näiteks meie kohustuste täitmiseks tervishoiuregulatsiooni ja rahvatervise seaduste alusel.</p></li></ul><h2>Kellega me jagame teie isikuandmeid</h2><p>Liikmesettevõtted ja kolmandate osapoolte teenusepakkujad.</p><p>Jagame teie andmeid kolmandate osapoolte müüjate, teenusepakkujate, lepingupartnerite või esindajatega ('kolmandad osapooled'), kes osutavad meile teenuseid või meie nimel ja vajavad sellise teabele juurdepääsu selle töö tegemiseks. Meil on kolmandate osapooltega sõlmitud lepingud, mis on loodud teie isikuandmete kaitseks. See tähendab, et nad ei saa teie isikuandmetega midagi teha, kui me pole neid selleks juhendanud. Samuti ei jaga nad teie isikuandmeid ühegi teise organisatsiooniga peale meie. Nad kohustuvad ka kaitsema andmeid, mida nad meie nimel hoiavad, ning säilitama neid perioodi vältel, mille me neile määrame. Kolmandate osapooltega, kellega võime isikuandmeid jagada, kategooriad on järgmised:</p><ul><li><p> Ravimitootjad (liikmesettevõtted)</p></li><li><p>Tehnilised teenusepakkujad</p></li></ul><h2>Kui kaua me teie isikuandmeid säilitame</h2><p>PharmaLedger Association säilitab teie tehnilisi andmeid ainult nii kaua, kui see on vajalik teie infolehe taotluse töötlemiseks kuni 30 päeva jooksul.</p><p>Teie ravimitootja säilitab teie andmeid määratud perioodi jooksul vastavalt nende andmete säilitamise poliitikaga, lisateabe saamiseks selle säilitamise kohta võtke ühendust oma ravimitootjaga.</p><h2>Kui te ei esita meile oma isikuandmeid</h2><p>Kui te otsustate meile oma tehnilisi andmeid mitte esitada, siis me ei saa täita teie infolehe taotlust.</p><h2>Teie õigused </h2><p>Kui teil on GDPR-i raames seotud isikuandmetega seotud taotlusi, näiteks juurdepääsu või andmete kustutamise taotlus, võite meiega ühendust võtta aadressil dpo@pharmaledger.org.</p><p>Me töötleme selliseid taotlusi 30 päeva jooksul.</p><h2>Nõusoleku tagasivõtmine</h2><p>Kui teil on GDPR-i raames seotud isikuandmetega seotud taotlusi, nagu juurdepääsu või andmete kustutamise taotlus, võite meiega ühendust võtta aadressil dpo@pharmaledger.org.</p><p>Me töötleme selliseid taotlusi 30 päeva jooksul. </p><h2>Automaatne otsuste tegemine</h2><p>Me ei kasuta teie teenindamisel ühtegi automaatset otsustusprotsessi.</p><h2>Isiklike andmete rahvusvaheline ülekanne</h2><p> Kui teie ravimitootja nõuab, et me edastaksime teie andmeid väljapoole Euroopa Liitu, kasutame teie andmete kaitsmiseks lepingu tüüptingimusi.</p><h2>Kuidas kaebust esitada</h2><p>Kui teil on GDPR-i raames seotud päringuid oma isikuandmete kohta, nagu näiteks juurdepääsu või andmete kustutamise taotlus, võite meiega ühendust võtta aadressil dpo@pharmaledger.org.</p><p>Me töötleme selliseid taotlusi 30 päeva jooksul. Lisaks võite pöörduda oma kohaliku järelevalveasutuse poole, kui tunnete, et teie õigusi ei järgita.</p>",
