  "terms_content": "<h2>PharmaLedger Association'i elektroonilise tooteinfo veebisaidi ja rakenduse kasutustingimused</h2><p>PharmaLedger Association'i elektroonilise tooteinfo veebisaidi ja rakenduse (edaspidi \"Teenused\") kasutamisega nõustute nende kasutustingimustega (edaspidi  \"Tingimused\"). Te ei tohi juurde pääseda ega kasutada Teenuseid, kui te ei nõustu nende Tingimustega. Teenuseid opereerib PharmaLedger Association (edaspidi \"Ühing\") ja need on mõeldud kasutamiseks isikutele, kes otsivad teavet oma ravimite kohta. Teenuseid edastab mitmepoolne võrk ning teie ravimitootja varustab Teenuste kaudu kuvatava toote teabega. Ühing tegutseb selle teabe andmehaldurina.</p><h2>Teenuste kasutamine</h2><p>Te nõustute kasutama Teenuseid ainult seaduslikeks eesmärkideks ning viisil, mis ei riku kolmandate isikute õigusi ega piira ega takista Teenuste kasutamist ja nautimist kolmandate isikute poolt. Selline piirang või takistus hõlmab muu hulgas ebaseaduslikku käitumist või sellist käitumist, mis võib kedagi ahistada või põhjustada ebamugavust või häirimist, ning solvava sisu edastamist või Teenustes dialoogi tavapärase voo häirimist.</p><h2>Intellektuaalomand</h2> <p> Teenuste sisu, sealhulgas, kuid mitte ainult, tekst, graafika, pildid ja tarkvara, on Ühingu või selle litsentsisaajate ja liikmesettevõtete omand ja seda kaitsevad autoriõigus ja muud intellektuaalomandi seadused. Te ei tohi kasutada ühtegi Teenuste sisu kommertseesmärkidel ilma Ühingu selgesõnalise kirjaliku loata.</p> <h2>Vastutus</h2><p>Ühing ei anna mingit tüüpi esindusi ega garantiisid, ei otseseid ega kaudseid, Teenuste toimimise või Teenustes sisalduva teabe, sisu, materjalide või toodete kohta. Ühing ei vastuta Teenuste kasutamisest tulenevate mingisuguste kahjude eest, sealhulgas, kuid mitte ainult, otsese, kaudse, juhusliku, karistava ja kaudse kahju eest.</p><h2>Kohaldatav seadus</h2><p>Need Tingimused ja Teie Teenuste kasutamine alluvad Šveitsi seadustele ning mis tahes vaidlused lahendatakse Baselis, Šveitsis.</p><h2>Muudatused tingimustes</h2><p>Ühingul on õigus neid Tingimusi igal ajal muuta ning teie vastutate nende Tingimuste perioodilise kontrollimise eest muudatuste osas. Teie Teenuste jätkuv kasutamine pärast Tingimuste muutmist tähendab muudetud Tingimuste aktsepteerimist.</p>",
