  "about_content": "<h2>Selle rakenduse kohta</h2>\n<p>See rakendus on teile pakutud PharmaLedger® poolt. Seda arendasid koos patsiendi esindusorganisatsioonid, ravimifirmad ja tehnoloogia eksperdid.</p><p>Rakendus võimaldab kasutajatel skaneerida tootepakendil olevat vöötkoodi, et vaadata teavet oma ravimi kohta.</p><p>Näidatud teave on pärit toote müügiloa omanikult.</p><h2>PharmaLedger kohta</h2><p>PharmaLedger® on PharmaLedger Association (PLA) kaubamärk.</p><p>PLA on globaalne mittetulunduslik, neutraalne ühing. Ühingu eesmärk on luua ja propageerida digitaalset usaldusökosüsteemi tervishoius.</p><p>Ühing soodustab koostööd tervishoiu- ja bioteaduste sektoris ning edendab uuendusi ja nende rakendamist patsientide ja teiste sidusrühmade ühiseks hüvanguks.</p>",
