  "help_modal_subtitle": "KKK-d",
  "help_content": "<div><p><b>Mis on EPI?</b></p><p><b>EPI</b> on lühend elektroonilise tooteinfo kohta. See on elektrooniline versioon tavaliselt ravimipakendi sees leiduvast paberkandjal tooteinfo lehest. Mõnel juhul võib <b>EPI</b> asendada paberkandjal infolehe.</p><p><b>Mis on PharmaLedger?</b></p><p>PharmaLedger Association (PLA) on mittetulundusühing, mille peakontor asub Šveitsis, ja selle eesmärk on võimaldada ja soodustada usaldusväärset digitaalset ökosüsteemi tervishoius standardiseeritud ja usaldusväärse avatud lähtekoodiga platvormi abil. PLA soodustab koostööd, kiirendab innovatsiooni ja rakenduste kasutuselevõttu, et saavutada vastastikune kasu tervise- ja bioteaduste valdkonnas patsientidele ja teistele sidusrühmadele. PLA loodi 2022. aastal jätkama PharmaLedgeri projekti tööd, mis oli kolmeaastane projekt, mida rahastas Euroopa Komisjon ja farmaatsiatööstus ning mille eesmärk oli tõestada plokiahela lahenduste väärtust. Lisateavet leiate veebisaidilt https://pharmaledger.org.</p><p><b>Mis on DataMatrix?</b></p><p>See on üks vöötkoodi tüüp teie tootepakendil. See on mustvalge ruudukujuline vöötkood ja näeb välja sarnane sellele:<br> <img src=\"./images/barcode_example.png\" alt='DataMatrix 条形码示例'></p><p><b>Kuidas rakendust kasutada?</b></p><p>Järgige <b>rakenduse</b> avalehel olevaid juhiseid... seal on näha pilt, kus leida tootepakendilt <b>DataMatrix</b>. Kui olete leidnud <b>DataMatrix</b>, klõpsake nuppu \"Skaneeri <b>DataMatrix </b>\"Andke rakendusele luba kasutada kaamerat, et saaksite <b>DataMatrix</b> skannida. Kasutage kaamerat, et keskenduda <b>DataMatrix</b>. Kui pakend on edukalt skannitud, kuvatakse <b>EPI</b>. Lisateabe saamiseks saate klõpsata nuppu ‘+’.</p><p><b>Miks minu DataMatrix'i skannimine ei anna tulemust?</b></p><p>On mitmeid põhjuseid, miks teie paketis olev <b>DataMatrix</b> ei pruugi EPI-d anda. Üks põhjusi võib olla kaamera fookus. Proovige koodi skannida hästi valgustatud kohas ja kood on ekraanil selgelt nähtav. Kui teil on raskusi oma käe paigal hoidmisega, võite proovida oma käte toetamiseks kasutada lauda.</p></div>",
